column8:
@Reza yg lu sebutin itu merk yg biasa d jual d sini dgan slogan, kalau jual kualitas apadanya aja bisa laku dgan harga mahal , ngapain d bikin bagus n kokoh gak ringkih.
Nyatanya teknologi mobil listrik itu udah jauh berkembang. Mobil d rendem aja masih berjalan dengan normal. 
Berrti kelistrikan pintu mobil yg lu sebutin itu sebenarnya bisa d bikin jauh lebih baik tahan air. Cuman ya gimna d jual gitu aja udah laku keras kok, ngapain ribet2 bikin yg bagus . Yg penting cuan coyyyy.

